import "../style/Layout.css";
import footerLogo from "../assets/LOGO.svg";

function Footer() {
  return (
    <footer>
      {footerLogo}
      <p>© 2020 Kasa. All rights reserved</p>
    </footer>
  );
}

export default Footer;
